var createParticles=function(t,a,i,e,r,s){this.particlesCount=t,this.particlesMaxSize=a,this.particlesMinSize=i,this.particlesLeft=e,this.particlesBottom=r,this.particlesMaxDelay=s};createParticles.prototype.getParticles=function(){for(var t=1;t<=this.particlesCount;t++){console.log("bubble "+t);var a=Math.floor(Math.random()*this.particlesMaxSize)+this.particlesMinSize,i=Math.floor(Math.random()*this.particlesBottom)+1,e=Math.floor(Math.random()*this.particlesLeft)+1,r=Math.floor(Math.random()*this.particlesMaxDelay)+1;$(".particles-wrapper .particles").append('<span class="particle particle-'+t+'" style="bottom:'+i+"%; left:"+e+"%;width:"+a+"px; height:"+a+"px;animation-delay: "+r+'s;"></span>')}};